import React from "react";
import { Button, Container  } from "shards-react";
import { Link } from '../../../routes';




export default class ProposalBar extends React.Component {

render() {
    return (  

    <div className="mb-4 d-flex ">
      <div className="card">
        <div className="card-body">
          <Container>
          <div className="col-sm d-flex justify-content-sm-center">
                <div className="col-xs col-sm d-flex justify-content-sm-center">
                  <div className="card-text">Vote</div>
                </div>  
                <div className="col-sm d-flex justify-content-sm-center">
                  <div className="card-text">On</div>
                </div>  
                <div className="col-sm d-flex justify-content-sm-center">
                  <div className="card-text">Current</div>
                </div>  
                <div className="col-sm d-flex justify-content-sm-center">
                  <div className="card-text">Asset</div>
                </div>  
                <div className="col-sm d-flex justify-content-sm-center">
                  <div className="card-text">Proposals</div>
                </div>  
                </div>
            
            </Container>
          </div>     
        </div>
        <style jsx>{` 
                  .card-text {margin-bottom:.1rem;font-family: Poppins;color:black;}
                  .card {width:35%;margin-bottom:0;}
                  .card-body {padding:.5rem;font-size:18px;font-weight:300;background-color:rgba(90,97,105,.06);} 
                  .arrow {color:#17c671;font-size:21px;font-weight:900;}
                  `}  
        </style>
    </div>

        );
    }
}
